window.bookSummaryJSON = "<p>A Council full of Ethereal Elders wants me dead. Yep, it's a regular Tuesday.</p> <p></p> <p>When you kill a demon there are consequences.</p> <p></p> <p>Centuries-old witch, tattoo artist, half-demon... none of those titles are going to save me this time. The only way I'm going to get out of my death sentence is to take down the biggest, baddest demon there is... My father.</p> <p></p> <p>And I thought being burned at the stake was bad...</p> <p></p> <p>Daughter of Souls &amp; Silence is the second book in the Rogue Ethereal Series. If you enjoy foul-mouthed heroines, dark humor, and enemies-to-lovers, then you'll love this series.</p>"; 
